"lastModified\":1435684962000,\"length\":195,\"url\":\"https://earthquake.usgs.gov/product/focal-mechanism/choy20100406221501/us/1435683543688/contents.xml\",\"sha256\":\"ABhLiaqdYWmIak24eD/csBAWouBShhatD9bUzLNEZFk=\"},\"quakeml.xml\":{\"contentType\":\"application/xml\",\"lastModified\":1435683543000,\"length\":2774,\"url\":\"https://earthquake.usgs.gov/product/focal-mechanism/choy20100406221501/us/1435683543688/quakeml.xml\",\"sha256\":\"8td7/jATboFdX2KNICzd7AB+AfygqflWdjg+xp89uko=\"}}}],\"general-text\":[{\"indexid\":\"13441161\",\"indexTime\":1610474339631,\"id\":\"urn:usgs-product:admin:general-text:usp000hat0-1510599079119:1510599097481\",\"type\":\"general-text\",\"code\":\"usp000hat0-1510599079119\",\"source\":\"admin\",\"updateTime\":1510599097481,\"status\":\"UPDATE\",\"properties\":{\"eventsource\":\"us\",\"eventsourcecode\":\"p000hat0\",\"original-signature\":\"\",\"original-signature-version\":\"v1\",\"pdl-client-version\":\"Version
        1.10.1 2016-04-07\",\"review-status\":\"Reviewed\",\"senderemail\":\"\"},\"preferredWeight\":1,\"contents\":{\"\":{\"contentType\":\"1\",\"lastModified\":1510599097000,\"length\":1747,\"bytes\":\"<h2>Tectonic
        Summary</h2>\\n<p>\\nThe April 6, 2010, M 7.8 northern Sumatra earthquake
        occurred as the result of shallow thrust faulting on or near the subduction
        interface plate boundary between the Indo-Australia and Sunda plates. At the
        location of this earthquake, the Australia and India plates move north-northeast
        relative to the Sunda plate at a velocity of about 60\u201365 mm/yr. On the
        basis of the currently available faulting mechanism information and earthquake
        depth, this earthquake likely occurred along the subduction interface. \\n</p>\\n<p>\\nWhile
        commonly plotted as points on maps, earthquakes of this size are more appropriately
        described as slip over a larger fault area. Thrust-faulting events of the
        size of the April 6, 2010, earthquake are typically about 120x50 km (length
        x width); modeling of this earthquake implies dimensions of about 80x60 km,
        predominantly surrounding and up-dip of the hypocenter.\\n</p>\\n<p>\\nThe
        subduction zone surrounding the immediate region of this event last slipped
        during the M 8.6 earthquake of March 2005, and the April 6th event appears
        to have occurred within the rupture zone of that earthquake. The April 6th
        earthquake is the latest in a sequence of large ruptures along the Sunda megathrust\u2014two
        M 7.4 earthquakes beneath Simeulue 125 km to the north in 2002 and 2008; a
        M 9.1 earthquake ruptured to within 125 km north of this earthquake in 2004;
        a M 8.5 earthquake broke the plate boundary 375 km to the south in 2007; and
        a M 7.6 earthquake 260 km to the south near Padang in 2009. \\n</p>\\n<p>\\nHayes
        et al. (2016) <a href=\\\"https://doi.org/10.3133/ofr20161192\\\">Tectonic
        summaries of magnitude 7 and greater earthquakes from 2000 to 2015</a>, USGS
        Open-File Report 2016-1192. (5.2 MB PDF)\\n</p>\",\"sha256\":\"bnIZNqPAE/lXq6LqxvGzY3b1zOfg/OC8Cy9kNst7nQQ=\"}}}],\"impact-text\":[{\"indexid\":\"13221221\",\"indexTime\":1610454897238,\"id\":\"urn:usgs-product:us:impact-text:usp000hat0:1415324473168\",\"type\":\"impact-text\",\"code\":\"usp000hat0\",\"source\":\"us\",\"updateTime\":1415324473168,\"status\":\"UPDATE\",\"properties\":{\"eventParametersPublicID\":\"quakeml:US.anss.org/eventParameters/pde20100406221501580_31/1415324473168\",\"eventsource\":\"us\",\"eventsourcecode\":\"p000hat0\"},\"preferredWeight\":8,\"contents\":{\"\":{\"contentType\":\"text/plain\",\"lastModified\":1415324473000,\"length\":728,\"bytes\":\"Felt
        (V) at Meulaboh and Sibolga; (IV) at Banda Aceh and Medan; (III) at Padangsidempuan,
        Samosir and Tarutung. Also felt at Belawan, Duri, Lhokseumawe and Padang.
        Felt at Bandung and Jakarta, Java and at Kuta, Bali. Felt (IV) at Butterworth
        and Perai; (III) at Ayer Itam, Gelugor Estate, George Town, Sungai Ara and
        Tanjong Bunga Estate; (II) at Banting, Kuala Lumpur, Petaling Jaya and Tanjong
        Malim, Malaysia. Felt along the west coast of Peninsular Malaysia and (II)
        in Singapore. Also felt at Male, Maldives. A tsunami was recorded along the
        coast of Sumatra with heights (center-to-peak) at the following tide stations:
        44 cm at Meulaboh, 19 cm at Sibolga, 17 cm at Telukdalam, 7 cm at Padang and
